<script type="text/javascript">
    function setCookie(name,value,days) {
        var expires = "";
        if (days) {
            var date = new Date();
            date.setTime(date.getTime() + (days*24*60*60*1000));
            expires = "; expires=" + date.toUTCString();
        }
        document.cookie = name + "=" + (value || "")  + expires + "; path=/";
    }

    function getUrlParameter(sParam) {
        var sPageURL = window.location.search.substring(1),
            sURLVariables = sPageURL.split('&'),
            sParameterName,
            i;

        for (i = 0; i < sURLVariables.length; i++) {
            sParameterName = sURLVariables[i].split('=');

            if (sParameterName[0] === sParam) {
                return sParameterName[1] === undefined ? true : decodeURIComponent(sParameterName[1]);
            }
        }
    }

    function setLauncherCookie() {
        var launcherPort = getUrlParameter("portaLauncher");
        if(launcherPort !== undefined) {
            setCookie("portaLauncher", launcherPort, 365);
        }
      }

    function tryOpen() {
        $.ajax({
            url: '/portal',
            type: 'GET',
            async: false,
            retryTimes: 1,
            error: function (xhr, textStatus, errorThrown) {
                if (this.retryTimes == 12) {
                    $("#loader").css('display', 'none');
                    $("#installer").css('display', 'block');
                } else {
                    $("#header").css('display', 'block');
                    $("#wrapper").css('display', 'block');
                    this.retryTimes++
                }
            }
        }).retry({times: 12, timeout: 10000}).then(function () {
            document.location.href = "/portal"
        });
    }

    function checkInstall() {
        $.ajax({
            url: '/winthor/ferramenta/servidor/v1/funcionalidade/maven/winthor/disponiveis',
            type: 'GET',
            success: function (result) {
                console.log(result);
                if(result) {
                    document.location.href = "/instalador"
                }
                tryOpen();
            },
            error: function (xhr, textStatus, errorThrown) {
                $("#header").css('display', 'block');
                $("#wrapper").css('display', 'block');
                tryOpen();
            }
        })
    }
    setLauncherCookie();
    checkInstall();
</script>
